import React, { Component } from 'react';
import { Button, Paper, Skeleton } from '@mui/material';
import Grid from '@mui/material/Unstable_Grid2';
import SendIcon from '@mui/icons-material/Send';
import ResponsiveAppBar from './appBar';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

const Home = () => {
    return (
        <>
            <ResponsiveAppBar />
            <Grid container spacing={{ xs: 2, md: 3 }} columns={{ xs: 4, sm: 8, md: 12 }} style={{ margin: '1rem' }}>
                {Array.from(Array(6)).map((_, index) => (
                    <Grid xs={2} sm={4} md={4} key={index}>
                        <Paper elevation={2}>
                            <Skeleton variant='rectangular' width={'100%'} height={200} />
                            <Typography variant='subtitle1'>Course Titile</Typography>
                            <Typography variant='body2' color='initial'>
                                Lorem ipsum dolor sit, amet consectetur adipisicing elit. Dolores hic commodi, fugiat
                                sed quasi amet!
                            </Typography>
                            <Typography variant='body2' color='initial' mt={2}>
                                44 number of videos
                            </Typography>
                        </Paper>
                    </Grid>
                ))}
            </Grid>
        </>
    );
};

export default Home;
